import React from 'react';
import './AuthPage.css';
import Button from "../Button/Button";

const AuthPage = () => {


    return (
        <div>
            <h1>Пожалуйста авторизируйтесь</h1>
            <form action="">
                <label htmlFor="">Логин</label>
                <input  type="text"/>
                <label htmlFor="">Пароль</label>
                <input type="password"/>
                <Button>Войти</Button>
            </form>

        </div>
    );
};

export default AuthPage;
